import React from 'react';
import Card from './Card';


const CardList = ({robots}) => {

    const eachRobot = (robots) => {
        robots.map(robot => {
            return robot
        })
    }

  return (
    <div>
      <Card id={eachRobots.robot.id} name={robots[0].name} email={robots[0].email} />
      {/* <Card id={robots[1].id} name={robots[1].name} email={robots[1].email} /> */}
